INSERT INTO `bsl_offre` (`id_offre`, `nom_offre`, `description_offre`, `debut_offre`, `fin_offre`, `id_sous_theme`, `id_professionnel`, `adresse_offre`, `code_postal_offre`, `ville_offre`, `code_insee_offre`, `courriel_offre`, `telephone_offre`, `site_web_offre`, `visibilite_coordonnees`, `delai_offre`, `zone_selection_villes`, `actif_offre`, `user_derniere_modif`) VALUES
(1, 'Offre passée', 'Description de l\'offre...', '2016-01-01', '2016-12-31', 3, 1, '34 rue de Trianon', '51100', 'Reims', '51454', 'contact@miloreims.com', '03.26.40.30.34', 'www.miloreims.com', 0, 2, 0, 0, 1),
(3, 'open bar', 'all inclusive : En général le tout inclus signifie que tous les frais sont déjà  inclus dans le prix, hébergement boisson et repas. Cependant, les boissons importées, comme la plupart des vins et autres boissons alcoolisées, seront vraisemblablement à payer sur place.', '2017-01-01', '2017-12-31', 4, 1, '34 rue de Trianon', '51100', 'Reims', NULL, 'contact@miloreims.com', '03.26.40.30.34', 'www.miloreims.com', 0, 7, 0, 0, 1),
(2, 'Offre uniquement à Reims', 'ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.<br><br><img src="http://www.missionslocales-champagneardenne.com/frontend/images/default_template/logo_header.jpg"><br>\r\n\r\n<a href="http://www.lolo.com" target="_blank">Lolo</a> ', '2017-02-01', '2017-11-30', 4, 11, '95 avenue de France ', '75013', 'Paris', '', 'offre@lambda.fr', '010101', 'www.lambda.com', 0, 2, 1, 0, 1),
(4, 'Une autre offre open bar', 'Accordions\r\nConvert Weights\r\nAnimated Buttons\r\nSide Navigation\r\nTop Navigation\r\nJS Animations\r\nModal Boxes\r\nProgress Bars\r\nParallax\r\nLogin Form\r\nHTML Includes\r\nGoogle Maps\r\nLoaders', '2017-01-01', '2017-12-31', 3, 11, '95 avenue de France ', '75013', 'Paris', NULL, 'offre@lambda.fr', '010101', 'www.lambda.com', 0, 7, 0, 0, 1),
(5, 'Travailler mon CV et ma lettre de motivation', 'Le CV et la lettre de motivation sont les premiers pas dans la recherche d\'un emploi. Un conseiller pourra t\'aider à valoriser tes expériences et ton parcours pour ta recherche d\'emploi.', '2017-01-01', '2018-12-31', 3, 2, '41 rue de Talleyrand', '51100', 'Reims', '51454', 'contact@jeunes-ca.fr', '010101', 'https://jeunes-ca.fr/', 0, 7, 0, 1, 1),
(6, 'Confirmer ton projet professionnel', '<b>Pendant 4 jours </b>confirme ton projet professionnel dans un centre de <u>formation </u>de l\'<a href="http://www.afpa.org">AFPA</a>. <i>Commence </i>en essayant un métier pendant 35 heures sur le plateau technique de l\'AFPA. Pendant une journée, fais l\'inventaire de tes compétences et découvre les opportunités d\'emploi. Un atelier confiance en soi (jeu de mémoire, travail de respiration...) te permettra de te préparer à tes entretiens d\'embauche. Puis finis en faisant un point sur les compétences à avoir pour confirmer ton projet professionnel. Ce programme, Declic pour l\'action est géré par la Mission locale, n\'hésite pas à leur demander de t\'inscrire. ', '2017-01-01', '2017-12-31', 3, 1, '34 rue de Trianon', '51100', 'Reims', '51454', 'contact@miloreims.com', '010101', 'www.miloreims.com', 0, 7, 0, 1, 1),
(7, 'Préparer ton entretien d\'embauche', 'Un conseiller t\'aide à  te préparer à ton entretien en simulant avec toi un entretien en situation réelle (ce qu\'il faut dire, ce qu\'il ne faut pas dire)... ', '2017-01-01', '2017-12-31', 3, 1, '34 rue de Trianon', '51100', 'Reims', '51454', 'contact@miloreims.com', '010101', 'www.miloreims.com', 0, 7, 0, 1, 1),
(23, 'Offre ML essai 2', 'Forum emploi les 4 et 5 juillet<br>16-18<br>Non handicap<br>Permis oui<br>Job étudiant seulement<br>Aucune études et aucun diplôme exclus<br>Expérience emploi oui<br>Temps partiel oui<br>', '2017-06-22', '2018-06-22', 4, 1, '34 rue de Trianon ', '51100', 'Reims', '51454', 'contact@miloreims.com', '03.26.40.30.34', 'www.miloreims2.com ', 0, 3, 0, 0, 5),
(24, 'test mission locale', '', '2017-06-22', '2018-06-20', 3, 1, '34 rue de Trianon ', '51100', 'Reims', '51454', 'contact@miloreims.com', '03.26.40.30.34', 'www.miloreims2.com ', 0, 3, 1, 0, 5),
(25, 'Accéder à un espace informatique en libre accès', '<b>Pour m’aider dans toutes mes démarches :</b>\r\n<br>-&gt; <u>J’ai accès sur place  à des outils informatiques et à internet,</u> au \r\ntéléphone fixe, et je peux envoyer mes candidatures par courrier \r\n<br>-&gt; <u>Des conseillers facilitent mes démarches pour accéder à un emploi</u>, à \r\nune formation, à un stage, au renseignement  de dossiers administratifs \r\n(auprès de la CAF, de Pôle emploi, etc…).', '2017-06-27', '2018-06-27', 3, 34, '27 avenue de Brétigny 91700 Sainte Geneviève des Bois', '91700', 'Ste Genevieve Des Bois', '91549', 'a.dumay@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?re', 0, 5, 1, 1, 4),
(22, 'Essai sur une commune -(Fismes)', '<b>Vérifier </b>si cette offre n\'est prise en compte que lorsque le jeune habite sur <a href="https://fr.wikipedia.org/wiki/Fismes"><u>Fismes</u></a><br><br>Voir la place de la mairie&nbsp;<div><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/Place_de_la_mairie_Fismes_3187.jpg/320px-Place_de_la_mairie_Fismes_3187.jpg"><br></div>', '2017-06-21', '2018-06-30', 4, 22, '26 rue Paul Adam', '51100', 'Reims', '51454', 'reims@asso-reims.fr', '', 'asso-reims.fr', 0, 2, 1, 0, 5),
(26, 'Bénéficier d\'un accompagnement personnalisé pour trouver un emploi et être autonome', '<b>Si je suis volontaire et motivé par mon avenir professionnel</b> , si je \r\nsuis prêt à m\'engager par contrat pour y parvenir, alors :<br>-&gt; je peux \r\nbénéficier d’un accompagnement collectif et/ou individuel <u>pour acquérir \r\nde nouvelles compétences professionnelles </u><br>-&gt; je renforce <u>mes chances \r\nd’accéder à l’emploi.</u>', '2017-06-27', '2018-06-27', 9, 34, '27 avenue de Brétigny', '1700 ', 'Sainte Geneviève des Bois ', '', 'garantie.jeunes@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?ref=page_internal', 0, 7, 1, 1, 4),
(27, 'Construire ton projet d\'orientation professionnelle', 'Dans le cadre d’un atelier collectif je suis aidé par un conseiller \r\npour:\r\n-	élaborer ou commencer l’élaboration de mon projet professionnel.\r\n-	affiner mes choix de métiers en explorant des métiers et fiches \r\nmétiers afin de mieux les connaitre, de comprendre leurs exigences, \r\nleurs contraintes, la formation nécessaire, et travailler mes \r\nmotivations à exercer le métier visé.\r\n-	travailler et acquérir les aptitudes nécessaires pour être employable\r\n-	mieux maîtriser mon entretien d’embauche et ma posture en tant que \r\nsalarié.\r\n-	effectuer des enquêtes professionnelles et/ou des stages d’immersion \r\n(chez un employeur)\r\n-	et finalement, valider ou invalider mon projet professionnel.', '2017-06-27', '2018-06-27', 9, 34, '27 avenue de Brétigny', '1700 ', 'Sainte Geneviève des Bois ', '', 'a.dumay@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?re', 0, 5, 1, 1, 1),
(28, 'Avoir un rendez vous gratuit et confidentiel avec un juriste ou un avocat', '<b>Je peux rencontrer un  conseiller juridique  pour l’interroger sur mes \r\ndroits </b>dans de multiples domaines : <br><br>-&gt; Emploi, formation, vie quotidienne, \r\nsanté, logement, vie quotidienne, consommation, etc....', '2017-06-27', '2018-06-27', 14, 34, '27 avenue de Brétigny', '1700 ', 'Sainte Geneviève des Bois ', '', 'a.dumay@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?re', 0, 5, 1, 1, 4),
(29, 'Découvrir et utiliser des techniques et des méthodes efficaces pour améliorer tes chances d\'accéder à l\'emploi', 'Pour renforcer mes chances d’accéder à l’emploi : \r\n- j’apprends les différentes techniques et méthodes de recherche \r\nd’emploi (je fais des CV bien construits, des lettres de motivation \r\nconvaincantes, je m’entraîne pour passer  un entretien d’embauche, je \r\ndécouvre comment trouver les entreprises qui embauchent, etc…)\r\n\r\n- je suis accompagné par un conseiller pour trouver un emploi.', '2017-06-27', '2018-06-27', 3, 34, '27 avenue de Brétigny', '1700 ', 'Sainte Geneviève des Bois ', '', 'a.dumay@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?re', 0, 5, 1, 1, 1),
(30, 'Construire mon projet professionnel', 'Dans le cadre d’un atelier « collectif » organisé à la ML,  je suis aidé\r\n par un conseiller pour:\r\n- élaborer ou commencer l’élaboration de mon projet professionnel;\r\n- affiner mes choix de métiers en explorant des métiers et fiches \r\nmétiers afin de mieux les connaître, de comprendre leurs exigences, \r\nleurs contraintes, la formation nécessaire, et travailler mes \r\nmotivations à exercer le métier visé ;\r\n- travailler et acquérir mes savoir-êtres et mes aptitudes nécessaires \r\npour être employable\r\nmieux maîtriser mon entretien d’embauche et ma posture en tant que \r\nsalarié;\r\n- effectuer des enquêtes professionnelles et/ou des stages d’immersion \r\n(chez un employeur)\r\net finalement, valider ou invalider mon projet professionnel.', '2017-06-27', '2018-06-27', 9, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge  ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 1),
(31, 'Maîtriser les outils de la recherche d’emploi et être accompagné pour trouver un emploi', 'Dans cet atelier, j’apprends les différentes techniques et méthodes \r\nrenforçant mes chances d’accès à l’emploi (faire des CV, des lettres de \r\nmotivation, simuler des entretiens, etc…). Je suis accompagné par un \r\nconseiller pour trouver un emploi.', '2017-06-27', '2018-06-27', 3, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge   ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 1),
(32, 'S’engager bénévolement pour une mission d’intérêt général à l’étranger ', 'Je m’engage bénévolement (non rémunéré) comme volontaire pour une \r\nmission d’intérêt général dans une communauté locale à l’étranger ou en \r\nFrance. J’apprends à vivre avec un collectif, dans un cadre qui mélange \r\nle rural et l’urbain.', '2017-06-27', '2018-06-27', 12, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge  ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 1),
(33, 'Bénéficier de conseils pour mon évolution professionnelle ', '<b>Je bénéficie d’un entretien individuel pour analyser ma situation \r\nprofessionnelle.</b> <br>-&gt; <u>Je suis conseillé pour définir mon projet professionnel\r\n </u><br>- <u>Je suis accompagné dans la mise en œuvre de mon projet.\r\n</u><br>À l\'issue de l\'entretien, <b>un document de synthèse</b> <b>m’est remis</b> : il \r\n<b>récapitule mon projet d\'évolution professionnelle et la stratégie \r\nenvisagée pour sa mise en œuvre </b>(par exemple, une formation éligible au \r\ncompte personnel de formation - CPF).', '2017-06-27', '2018-06-27', 9, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge  ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 4),
(34, 'Retrouver une motivation pour m’insérer professionnellement', 'Je bénéficie d’une écoute et d’un accompagnement sur tous les sujets qui\r\n me préoccupent. Je bénéficie de simulations en situation de travail et \r\nje suis orienté vers une action de formation conventionnée par le Région\r\n Ile de France afin :\r\n    *  de lever les freins qui m’empêchent d’accéder à un emploi\r\n    * d’acquérir des bases pour garantir le succès de parcours d’accès à\r\n l’emploi\r\n    * de me préparer à envisager mon insertion professionnelle.', '2017-06-27', '2018-06-27', 9, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 1),
(35, 'Bénéficier d’un lieu et d’un équipement informatique pour préparer mon accès à l’ emploi ', 'J’ai accès sur place  à des outils informatique et à internet, au \r\ntéléphone fixe, et je peux envoyer mes candidatures par courrier. Des \r\nagents facilitent mes démarches pour accéder à un emploi, à une \r\nformation, à un stage, au renseignement  de dossiers administratifs \r\n(auprès de la CAF, de Pôle emploi, etc…).', '2017-06-27', '2018-06-27', 3, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge  ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 1),
(36, 'Accéder à une formation pour résoudre mes difficultés avec la langue française et faciliter mon accès à l\'emploi', '<b>Si je ne connais pas bien la langue française :<br> </b><br>-&gt; <u>Je suis aidé(e) pour \r\naccéder à une formation qualifiante ou à un emploi,</u> pour sécuriser ainsi\r\n mon parcours vers l’emploi. <br><br>-&gt; <u>J’acquiers et je  développe  mes \r\ncompétences de base et je prépare une certification,</u> grâce à \r\nl’apprentissage du français.\r\n<br><br>-&gt; <u>Je fais des stages entreprises.</u><br><br>', '2017-06-27', '2018-06-27', 9, 35, '35 Rue Edouard Danaux', '1220 ', 'Brétigny-sur-Orge  ', '', 'sebastien.nich@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 2, 1, 1, 4),
(37, 'Dynamiser ma recherche d’emploi', 'Un Club t\'aider à trouver un stage ou un emploi en alternance, ou un \r\nemploi étudiant, un job alimentaire ou un emploi qualifié. Je teste mon \r\nprojet professionnel auprès des membres du Club, sur une demi journée. ', '2017-06-27', '2018-06-27', 4, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(38, 'Apprendre à parler aux employeurs des métiers qui m\'intéressent', 'En atelier collectif et en entretien, <b>je&nbsp; rencontre des \r\nprofessionnels pour connaître la réalité du métier.\r\n\r\n</b><br><br><b>Ces rencontres m\'apprendront aussi à poser les bonnes questions</b> pour \r\nobtenir des informations utiles (quelle formation pour ce métier, \r\nl’évolution du métier, les opportunités...).', '2017-06-27', '2018-06-27', 3, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 4),
(39, 'Partir à l’étranger pour faire un break ou pour être utile ou pour apprendre une langue', 'Comment ça marche ?\r\n\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- Je sais me présenter à l’entreprise\r\n- Je me sens plus à l’aise pour parler avec l’employeur\r\n- je dispose d’un guide qui me permet de me rappeler de ce qu’il faut faire\r\n- je sais me démarquer des autres candidats en restant moi même\r\n- je sais poser de bonnes questions pendant l’entretien d’embauche\r\n- je sais comment connaître l’employeur visé avant l’entretien.', '2017-06-28', '2018-06-28', 12, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(40, 'Apprendre à présenter mon profil à des employeurs', 'Comment ça marche ?\r\n\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n- j’apprends à faire une étude de marché\r\n- j’apprends à être percutant et synthétique\r\n- je sais faire une proposition de service à l’entreprise\r\n- je connais les arguments à utiliser pour convaincre les entreprises\r\nje me suis informé, j’ai pris des contacts avec des professionnels.', '2017-06-28', '2018-06-28', 3, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(41, 'Comment développer son réseau', 'Comment ça marche ?\r\n\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- j’ai recensé toutes les connaissances, parents ou amis qui peuvent m’aider à trouver un emploi ou un stage\r\n- j’ai appris à m’identifier sur des réseaux sociaux professionnels\r\n- j’ai identifié tous les professionnels qui peuvent m’aider dans ma démarche.', '2017-06-28', '2018-06-28', 3, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(42, 'Etre plus visible sur les réseaux sociaux', 'Comment ça marche ?\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- je sais mieux m’identifier sur les réseaux sociaux professionnels (viadeo, linkedin, facebook, instagram, …)\r\n- j’ai identifié des relations professionnelles qui peuvent m’aider à me faire connaître\r\n- je publie des posts régulièrement grâce à mes messages automatisés.', '2017-06-28', '2018-06-28', 3, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(43, 'Etre utile, donner du sens à ma carrière professionnelle', 'Comment ça marche ?\r\n - je participe à un atelier collectif animé par un conseiller \r\nspécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel \r\navec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- je découvre beaucoup de solutions pour me rendre utile : bénévolat, \r\nvolontariat, service civique, créer son entreprise, s’engager dans \r\nl’armée, entreprendre dans l’économie sociale et solidaire, ce ne sont \r\npas les solutions qui manquent...', '2017-06-28', '2018-06-28', 12, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(44, 'Trouver des jobs saisonniers', 'Comment ça marche ?\r\n\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n- je trouve des offres auxquelles je peux candidater\r\n- je sais trouver des entreprises qui embauchent \r\n- je connais des sites d’offres d’emploi adaptés\r\n- je sais quels sont les forums dans lesquels je pourrai trouver des offres\r\n- j’ai un outil pour faire le suivi de mes demandes.', '2017-06-28', '2018-06-28', 5, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(45, 'Trouver des offres d’emploi', '<b><br><br><img src="null"><img src="http://www.ch-florac.org/medias/images/offre-emploi.gif">Comment ça marche ?</b>\r\n<br>\r\n<br>Dans un espace en libre service, je bénéficie des conseils d’un  \r\nconseiller spécialisé et j’ai accès à des outils pour m’aider à diffuser\r\n mon CV et lettre de motivation ou appeler un employeur.\r\n\r\n<br><br><b>Quels bénéfices je peux attendre de ce service  ?\r\n\r\n</b><br>-&gt; je m’informe sur les offres qui m’intéresse (je repère les \r\nentreprises, j’identifie les critères et les arguments à utiliser, les \r\nniveaux de formation, les missions à réaliser, le niveau informatique, \r\nle niveau de langue)\r\n<br>-&gt; je peux élargir ma recherche à des pistes d’employeurs potentiels (par\r\n secteur)\r\n<br>-&gt; j’ai des contacts pour démarcher des entreprises et auprès de \r\npersonnes relais qui peuvent m‘aider à trouver des offres d’emploi.', '2017-06-28', '2017-07-06', 5, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 4),
(46, 'Etre informé.e et préparé.e pour les forums Jobs', 'Comment ça marche ?\r\n\r\n- je participe à un atelier collectif animé par un conseiller spécialisé\r\n- à la fin de l’atelier je peux bénéficier d’un entretien individuel avec le conseiller spécialisé\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- je suis informé des différents forums emploi ou alternance ou orientation sur mon territoire\r\n\r\n- Je peux connaitre la liste des entreprises présentes\r\n\r\n- Je reçois des conseils pour rendre ma visite efficace dans ces forum. ', '2017-06-28', '2018-06-28', 4, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(47, 'Gagner la carte jeune européenne', 'Comment ça marche ?\r\n\r\n- je participe à un jeu sur place au CIDJ  qui me permet de gagner une \r\ncarte de services valables au niveau européen.\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- j’ai accès à des tarifs préférentiels liés à la mobilité européenne ( \r\ntransport, se loger, les bons plans pour partir à l’étranger).', '2017-06-28', '2018-06-28', 13, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(48, 'Trouver une aide financière pour passer le BAFA', 'Comment ça marche ?\r\n\r\n- je candidate pour obtenir l’aide\r\nJ‘expose mes motivations pour bénéficier de l’aide\r\n- je peux être aidé par un conseiller spécialisé pour remplir ma demande d’aide\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n-  je suis averti du suivi de mon dossier et s’il est retenu\r\n- je suis sollicité pour consacrer des heures citoyennes en échange de cette aide\r\n- j’ai la possibilité de bénéficier d’une aide financière pour passer mon BAFA.', '2017-06-28', '2018-06-28', 13, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(49, 'Trouver « le métier qui me plait »', 'Comment ça marche ?\r\n\r\n- j’ai accès à des logiciels professionnels en libre service pour \r\ndéterminer mes préférences  \r\n- je réponds à des questions qui m’aident à identifier un secteur \r\nd’activité qui m’intéresse \r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- je suis informé sur des métiers qui pourraient m’intéresser car ils \r\nrépondent à mon profil\r\n- j’ai un entretien avec un conseiller spécialisé pour m’informer sur \r\nles formations qui conduisent à ce ou ces métier(s) et pour échanger sur\r\n les résultats des questionnaires.', '2017-06-28', '2018-06-28', 5, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(50, 'Trouver un métier qui corresponde à mes études', 'Comment ça marche ?\r\n\r\n- j’ai un entretien avec un conseiller pour m’aider à trouver un métier en rapport avec mes études\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- je bénéficie de contacts me permettant de rencontrer des entreprises dans le secteur d’activité concerné.', '2017-06-28', '2018-06-28', 9, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(51, 'Accéder à des métiers qui recrutent', '<b>Comment ça marche ?</b>\r\n\r\n<br><br>-&gt; J’ai accès à un libre service dans lequel je peux consulter une documentation professionnelle sur les métiers qui recrutent \r\n<br>-&gt; Je peux bénéficier d\'un entretien avec un conseiller pour m’aider à trouver un métier en rapport avec mes études\r\n\r\n<br><b><br>Quels bénéfices je peux attendre de ce service  ?</b>\r\n\r\n<br>-&gt; Je peux consulter le guide des secteurs d’activité et des métiers qui recrutent\r\n<br>-&gt; Je suis informé des formations qui permettent d’accéder aux métiers de ces secteurs\r\n <br>-&gt; Je découvre les sites internet ciblés selon le secteur d’activité\r\n<br>-&gt; Je trouve les entreprises qui recrutent notamment près de chez moi.', '2017-06-28', '2018-06-28', 9, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 4),
(52, 'Faire un stage à l’étranger', 'Comment ça marche ?\r\n\r\n- j’ai un entretien avec un conseiller pour m’aider à trouver un stage à l’étranger\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n-j’identifie ce qu’il faut faire pour accéder à des séjours organisés à l’étranger\r\n- si des aides sont possibles, le conseiller me les propose\r\n- si des aides sont possibles, un conseiller m’aide à les demander et à faire mon dossier\r\n- je suis averti de l’acceptation ou du refus de ma demande.', '2017-06-28', '2018-06-28', 5, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(53, 'Venir avec (ou sans) ses parents discuter des possibilités d’études pour l’après BAC ', 'Comment ça marche ?\r\n\r\n- un conseiller anime la discussion collective d’un groupe de jeunes et \r\nde parents et répond aux questions autour d’un café - croissants\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- grâce à cette discussion collective, cela m’ouvre des perspectives que\r\n je n’avais pas envisagé\r\n- je peux poser toutes mes questions et je constate que je ne suis pas \r\nle seul dans mon cas\r\n- le conseiller spécialisé donne des informations  précises et vérifiées\r\n- je peux consulter des documentations professionnelles et/ou des sites \r\nspécialisés qui expliquent les différentes possibilités.', '2017-06-28', '2018-06-28', 4, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(54, 'Discuter des possibilités d’études après le collège', 'Comment ça marche ?\r\n\r\n- un conseiller anime la discussion collective d’un groupe de jeunes et \r\nde parents et répond aux questions autour d’un café - croissants\r\n\r\nQuels bénéfices je peux attendre de ce service  ?\r\n\r\n- grâce à cette discussion collective, cela m’ouvre des perspectives que\r\n je n’avais pas envisagées\r\n- je peux poser toutes mes questions et je constate que je ne suis pas \r\nle seul dans mon cas\r\n- le conseiller spécialisé donne des informations  précises et vérifiées\r\n- je peux consulter des documentations professionnelles et/ou des sites \r\nspécialisés qui expliquent les différentes possibilités.', '2017-06-28', '2018-06-28', 4, 37, '101 quai Branly', '75015', 'Paris', '', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 0, 1, 1),
(55, 'Faire mon CV et ma lettre de motivation ', 'Les bénéfices que je peux attendre de ce service :\r\n- je sais créer et mettre en forme un CV personnalisé, trouver des modèles\r\n- je suis rassuré(e) car je sais que je pourrais recommencer\r\n- Je sais faire une lettre de motivation personnalisée et  adaptée à l’offre d‘emploi que je vise\r\n- j’ai pris conscience de mes compétences et je sais en parler.', '2017-06-28', '2018-06-28', 3, 42, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', '', 0, 5, 1, 1, 1),
(56, 'Faire mon CV et ma lettre de motivation ', 'Les bénéfices que je peux attendre de ce service :\r\n- je sais créer et mettre en forme un CV personnalisé, trouver des modèles\r\n- je suis rassuré(e) car je sais que je pourrais recommencer\r\n- Je sais faire une lettre de motivation personnalisée et  adaptée à l’offre d‘emploi que je vise\r\n- j’ai pris conscience de mes compétences et je sais en parler.', '2017-06-28', '2018-06-28', 3, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(57, 'Préparer mon entretien d’embauche', 'Les bénéfices que je peux attendre de ce service :\r\n\r\n- je sais me présenter à l’entreprise\r\n- je me sens plus à l’aise pour parler avec l’employeur\r\n- je dispose d’un guide qui me permet de me rappeler de ce qu’il faut faire\r\n- je sais me démarquer des autres candidats en restant moi même\r\n- je sais poser de bonnes questions pendant l’entretien d’embauche\r\n- je sais comment connaître l’employeur visé avant l’entretien.', '2017-06-28', '2018-06-28', 3, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(58, 'Rechercher un stage', 'Les bénéfices que je peux attendre de ce service :\r\n- je dispose d’un outil pour faire le suivi de mes demandes\r\n- je sais élargir ma recherche de stage sur l’ensemble de mon  territoire \r\n- j’accède à des plateformes de recherche de stages.', '2017-06-28', '2018-06-28', 5, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(59, 'Trouver des jobs saisonniers', 'Les bénéfices que je peux attendre de ce service :\r\n- je trouve des offres auxquelles je peux candidater\r\n- je sais trouver des entreprises qui embauchent \r\n- je connais des sites d’offres d’emploi adaptés (par exemple : <a href="http://www.localemploi.fr/">http://www.localemploi.fr/</a>: un emploi près de chez moi) \r\n- je sais quels sont les forums dans lesquels je pourrai trouver des offres\r\n- j’ai un outil pour faire le suivi de mes demandes', '2017-06-28', '2018-06-28', 5, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(60, 'Consulter des offres d’emploi proposées près de chez moi', 'Les bénéfices que je peux attendre de ce service :\r\n- je peux consulter des offres localisées et affichées\r\n- j’ai des pistes d’employeurs potentiels\r\n- j’ai des contacts pour démarcher des entreprises et auprès de \r\npersonnes relais qui peuvent m‘aider à trouver des offres d’emploi\r\n- j’ai des outils pour m’aider à diffuser les CV et lettre ou appeler un\r\n employeur.', '2017-06-28', '2018-06-28', 5, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(61, 'Trouver une aide financière pour passer le permis ', '<b>Les bénéfices que je peux attendre de ce service :\r\n<br><br></b>-&gt; Je candidate pour obtenir l’aide\r\n<br>-&gt; Je suis sollicité.e pour consacrer des heures citoyennes en échange de cette aide\r\n<br>-&gt; Je suis aidé.e à proposer un projet « citoyen » pour candidater à cette aide\r\n<br>-&gt; Je suis averti.e du suivi de mon dossier et s’il est retenu.', '2017-06-28', '2018-06-28', 13, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 4),
(62, 'Trouver une aide financière pour passer le BAFA sur mon territoire', 'Les bénéfices que je peux attendre de ce service :\r\n- je candidate pour obtenir l’aide\r\n- j‘expose mes motivations pour bénéficier de l’aide\r\n- je suis averti(e) du suivi de mon dossier et s’il est retenu\r\n- je suis sollicité(e) pour consacrer des heures citoyennes en échange de cette aide.', '2017-06-28', '2018-06-28', 13, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(63, 'Trouver « le métier qui me plait »', 'Les bénéfices que je peux attendre de ce service :\r\n- je réponds à des questions qui m’aident à identifier un secteur d’activité qui m’intéresse sur un logiciel professionnel\r\n- je suis informé(e) sur les métiers qui pourraient m’intéresser\r\n- j’ai un entretien pour m’informer sur les formations qui conduisent à ce ou ces métier(s).', '2017-06-28', '2018-06-28', 5, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(64, 'Trouver un métier qui corresponde à mes études', 'Les bénéfices que je peux attendre de ce service :\r\n- j\'ai un entretien avec un conseiller pour m’aider à trouver un métier en rapport avec mes études\r\n- je peux bénéficier de contacts me permettant de rencontrer des entreprises dans le secteur d’activité concerné.', '2017-06-28', '2018-06-28', 9, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(65, 'Accéder à des métiers qui recrutent', '<b>Les bénéfices que je peux attendre de ce service :</b>\r\n<br>-&gt; je peux consulter le guide des secteurs d’activité et des métiers qui recrutent\r\n<br>-&gt; je suis informé(e) des formations qui permettent d’accéder aux métiers de ces secteurs\r\n<br>-&gt;  je connais les sites internet ciblés selon le secteur d’activité\r\n<br>-&gt; je connais les entreprises qui recrutent notamment près de chez moi.', '2017-06-28', '2018-06-28', 9, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 4),
(66, 'Faire un stage à l’étranger', 'Les bénéfices que je peux attendre de ce service :\r\n- j’identifie ce qu’il faut faire pour accéder à des séjours organisés à l’étranger\r\n- si des aides sont possibles, j’en suis averti(e)\r\n- si des aides sont possibles, je suis aidé(e) pour les demander et pour faire mon dossier\r\n- je suis averti(e) de l’acceptation ou du refus de ma demande.', '2017-06-28', '2018-06-28', 5, 43, '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'f.gil@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 5, 1, 1, 1),
(67, 'Bénéficier d\' une aide juridique gratuite et confidentielle pour porter plainte contre mon employeur', '<b>Un juriste ou un avocat peut m\'aider à porter plainte</b> et éventuellement à\r\n demander des dommages et intérêts <b>si je suis victime d’un acte \r\nrépréhensible de la part de mon employeur </b>(par exemple : harcèlement, \r\nrefus de contractualisation, non paiement des heures réalisées, paiement\r\n du travail en liquide sans feuille de paye, etc...).', '2017-06-28', '2018-06-28', 3, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 4),
(68, 'Demander l\'effacement de mon casier judiciaire pour des délits mineurs', 'Un juriste ou un avocat me renseigne gratuitement sur la procédure à \r\nsuivre pour demander l\'effacement de mon casier judiciaire si j’ai \r\ncommis des délits mineurs afin de pouvoir accéder à certains emplois ou \r\nmétiers (sécurité, enseignement, etc…).\r\n', '2017-06-28', '2018-06-28', 14, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(69, 'Lutter contre les discriminations dont je suis victime pour accéder à un emploi ou pour m\'y maintenir', 'Dans le cas où j’estime être victime de discrimination (par exemple au \r\ntravail, ou pour accéder à un emploi, à une formation, à un \r\naccompagnement...) je peux bénéficier de conseils juridiques gratuits et\r\n confidentiels pour rétablir mes droits.', '2017-06-28', '2018-06-28', 14, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(70, 'M\'informer sur la conformité de mon contrat de travail, de mes feuilles de paye et/ou sur mon licenciement', 'Je rencontre un juriste qui pourra me renseigner sur la conformité de \r\nmon contrat de travail, de mes feuilles de paye, ou sur un éventuel \r\nlicenciement, ou sur toutes questions relevant du droit du travail.\r\n', '2017-06-28', '2018-06-28', 14, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(71, 'M\'informer sur mes droits à travailler en France si je suis étranger', 'Je suis étranger et je souhaite obtenir  des informations ou une aide \r\npour connaître mes droits au travail lors de mon séjour en France. Je \r\npeux bénéficier d\'une consultation gratuite avec une juriste ou un \r\navocat spécialisé dans le droit des étrangers.', '2017-06-28', '2018-06-28', 14, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(72, 'Trouver un avocat pour me défendre dans un litige avec mon employeur', 'Je peux être aidé à faire les démarches pour bénéficier des services \r\nd’un avocat gratuitement (en  fonction de mes ressources) afin d’être \r\ndéfendu en cas de litige avec mon employeur.', '2017-06-28', '2018-06-28', 14, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(73, 'M\'informer sur mes droits à travailler en France si je suis étranger', 'Je suis étranger et je souhaite obtenir  des informations ou une aide \r\npour connaître mes droits au travail lors de mon séjour en France. Je \r\npeux bénéficier d\'une consultation gratuite avec une juriste ou un \r\navocat spécialisé dans le droit des étrangers.', '2017-06-28', '2018-06-28', 3, 40, '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 0, 1, 1),
(74, 'test coeur d\'essonne', 'test coeur d\'essonne test coeur d\'essonne<br>', '2017-06-28', '2018-06-28', 3, 36, '1 Place Saint-Exupéry', '91700', 'Sainte-Geneviève-des-Bois', '', 'l.rochelle@coeuressonne.fr', '01 84 65 02 01', 'http://www.coeuressonne.fr/', 0, 2, 0, 1, 1),
(75, 'M’aider à financer mon projet d’études ou de formation', '', '2017-06-29', '2018-06-29', 3, 41, '1 Place Mendès France', '91000', 'Evry', '91228', 'sdali@cd-essonne.fr', '01 60 91 91 91', 'tremplin-citoyen.essonne.fr', 0, 2, 0, 0, 1),
(76, 'Simuler un entretien d\'embauche', '', '2017-07-11', '2018-07-11', 0, 44, '1-8 rue François Guyard', '51100', 'Reims', '51454', 'agorae@intercampus.fr', '03 26 91 88 23', 'https://intercampus.fr/site/l-innovation/agorae', 0, 7, 0, 0, 5),
(77, 'Simuler un entretien d\'embauche', '', '2017-07-11', '2018-07-11', 0, 44, '1-8 rue François Guyard', '51100', 'Reims', '51454', 'agorae@intercampus.fr', '03 26 91 88 23', 'https://intercampus.fr/site/l-innovation/agorae', 0, 7, 0, 0, 5),
(78, 'Travailler mon projet professionnel avec un conseiller', 'Les conseillers de l’APEC (Association Pour l’Emploi des Cadres) \r\nt’accompagneront dans la clarification de ton projet professionnel afin \r\nde mieux cibler ta recherche d’emploi.', '2017-07-11', '2018-07-11', 9, 54, '14 rue Edouard Mignot', '51100', 'Reims', '51454', 'jermouna.ahmed-malek@apec.fr', '03 26 79 82 74', 'Apec.fr', 0, 7, 0, 1, 5),
(79, 'Organiser ta recherche d’emploi', 'C’est ta première recherche d’emploi et tu ne sais pas par où commencer ?\r\n Après avoir analysé ta situation, un consultant peut t’aider à rédiger \r\ntes CV et lettres de candidature, identifier les entreprises à \r\ncontacter, préparer tes entretiens, développer ton réseau… Ensemble, \r\nvous bâtissez un plan d’action personnalisé pour poursuivre ta recherche\r\n en toute autonomie.', '2017-07-11', '2018-07-11', 3, 54, '14 rue Edouard Mignot', '51100', 'Reims', '51454', 'jermouna.ahmed-malek@apec.fr', '03 26 79 82 74', 'Apec.fr', 0, 7, 0, 1, 5),
(80, 'Anticipe et prépare ton évolution professionnelle', 'Tu as envie de changer de poste en interne ou dans une nouvelle \r\nentreprise ? Un consultant APEC t’aide à préparer un plan d’action pour \r\nchanger de poste à court terme. ', '2017-07-11', '2018-07-11', 9, 54, '14 rue Edouard Mignot', '51100', 'Reims', '51454', 'jermouna.ahmed-malek@apec.fr', '03 26 79 82 74', 'Apec.fr', 0, 7, 0, 1, 5),
(81, 'Découvre ton marché d’emploi', 'Un diplôme et ensuite ? Quelles pistes envisager ? Un consultant est à \r\nvotre écoute pour évaluer les différentes opportunités en fonction de \r\nvos projets et vos motivations.', '2017-07-11', '2018-07-11', 9, 54, '14 rue Edouard Mignot', '51100', 'Reims', '51454', 'jermouna.ahmed-malek@apec.fr', '03 26 79 82 74', 'Apec.fr', 0, 7, 0, 1, 5),
(82, 'Besoin d’un coup de pouce pour t’informer ou t’orienter ?', 'Le psychologue de l’orientation t’aide à préciser ton projet d’études \r\net/ou professionnel. L’Orientation est un processus complexe où les \r\ncompétences, les intérêts, les aspirations mais aussi les contraintes \r\ndoivent pouvoir s’exprimer pour être pris en compte et faire avancer la \r\nréflexion jusqu’à l’élaboration des choix. Le psychologue de \r\nl’orientation t’accompagne dans ce cheminement. \r\nIl peut également t’aider à rechercher et à décrypter les informations \r\nque tu trouves sur internet.', '2017-07-11', '2018-07-11', 9, 53, '17 boulevard de la paix', '51100', 'Reims', '51454', 'chantal.warin@ac-reims.fr', '03 26 05 80 77', 'http://www.ac-reims.fr/cid75537/cio-reims.html', 0, 5, 0, 1, 5),
(83, 'Trouve ton métier dans l’Armée de l’Air', 'Le CIRFA AIR t’informe sur les métiers de l’Armée de l’Air et les \r\ndifférents parcours professionnels possibles en fonction de ton cursus \r\net de ta volonté. Il peut également t’accompagner pour ton engagement \r\ndans l’Armée de l’Air.\r\nTu trouveras des formations complètes en fonction de ton niveau d’études\r\n (de la 3ème à Bac +5), de ton âge et de ta volonté de carrière.', '2017-07-11', '2018-07-11', 5, 51, '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'david.larquet@intradef.gouv.fr', '06 72 14 40 71', 'https://www.devenir-aviateur.fr', 0, 5, 0, 1, 5),
(84, 'Trouve ton métier dans la Marine ', 'Le CIRFA Marine t’informe sur les métiers de la Marine et les différents\r\n parcours professionnels possible en fonction de ton cursus et de ta \r\nvolonté. Il peut également t’accompagner pour ton engagement dans la \r\nMarine.\r\nTu y trouveras des formations complètes en fonction de ton niveau \r\nd’études (de la 3ème à Bac +5), de ton âge et de ta volonté de carrière.', '2017-07-11', '2018-07-11', 5, 50, '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'sebastien.navarette@intradef.gouv.fr', '03 51 42 41 17', 'https://www.etremarin.fr/', 0, 5, 0, 1, 5),
(85, 'Trouve ton métier dans l\'Armée de Terre', 'Le CIRFA Terre t\'informe sur les spécialités dans l\'Armée de Terre et \r\nles différents parcours professionnels en fonction de ton cursus et de \r\nta volonté. Un conseiller t\'accompagnera pour ton engagement dans \r\nl\'Armée de Terre de la simple information à ton engagement.\r\nTu trouveras des formations complètes en fonction de ton niveau d\'études\r\n (de sans diplôme à bac +5), de ton âge et de ta volonté de carrière.', '2017-07-11', '2018-07-11', 5, 49, '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'eric.queuvin@intradef.gouv.fr', '03 51 42 41 02', 'https://www.recrutement.terre.defense.gouv.fr/ou-n', 0, 2, 0, 1, 5),
(86, 'Fais le point sur ton projet professionnel', 'Un chargé d\'information t\'accompagne pour faire le point sur ton projet \r\nprofessionnel et t\'aide dans l\'organisation de tes recherches (emploi ou\r\n formation).', '2017-07-11', '2018-07-11', 9, 2, '41 rue de Talleyrand', '51100', 'Reims', '51454', 'accueildoc@crij-ca.fr', '03 26 79 84 79', 'https://jeunes-ca.fr/', 0, 7, 0, 1, 5),
(87, 'Relecture CV et lettre de motivation', 'Un chargé d’information est disponible pour relire ton CV / ta lettre de\r\n motivation afin de les améliorer et te donner des conseils.\r\nDes ordinateurs sont disponibles sur place pour que tu puisses faire les\r\n modifications tout de suite.', '2017-07-11', '2018-07-11', 3, 2, '41 rue de Talleyrand', '51100', 'Reims', '51454', 'accueildoc@crij-ca.fr', '03 26 79 84 79', 'https://jeunes-ca.fr/', 0, 3, 0, 1, 5),
(88, 'L’engagement : un autre moyen de développer tes compétences', 'Un chargé d’information te renseigne sur les engagements possibles \r\n(bénévolat, volontariat, service civique, service volontaire européen) \r\net peut t’aider à trouver une mission et à y postuler si tu es \r\nintéressé.', '2017-07-11', '2018-07-11', 12, 2, '41 rue de Talleyrand', '51100', 'Reims', '51454', 'accueildoc@crij-ca.fr', '03 26 79 84 79', 'https://jeunes-ca.fr/', 0, 3, 0, 1, 5),
(89, 'Accompagnement personnalisé vers l’emploi ou la formation', 'L’EPIDE propose un accompagnement personnalisé vers l’emploi ou la \r\nformation sous la forme d’un contrat rémunéré de 8 mois en régime \r\nd’internat du lundi au vendredi.', '2017-07-11', '2018-07-11', 9, 48, '140 Rue de la chaussée romaine', '02100', 'St Quentin', '02691', 'nathalie.lemoine@epide.fr', '06 64 02 43 11', 'www.epide.fr', 0, 5, 0, 1, 5),
(90, 'Découvre un métier ', 'Découvres un nouveau métier pour avoir une meilleure idée de ce que tu \r\nveux faire ou non ! Cela peut se faire sous forme d’informations via le \r\ncentre de ressources, de stage ou de rencontres professionnelles.', '2017-07-11', '2018-07-11', 5, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(91, 'Te former tout au long de la vie', 'Un conseiller t’informe des possibilités de formations selon tes envies et ton parcours.', '2017-07-11', '2018-07-11', 9, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(92, 'Les différents modes de transports pour l’emploi', 'Besoin d’information pour te déplacer ! Renseignes toi sur les aides au \r\npermis de conduire et sur les modes de transports alternatifs.', '2017-07-11', '2018-07-11', 13, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(93, 'Intéressé par la création d’entreprise ?', 'Un conseiller te guide et t’oriente en fonction de ton projet de création d’entreprise et de son avancement.', '2017-07-11', '2018-07-11', 9, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(94, 'Tu travailles et tu veux des conseils ? ', 'Un conseiller t’accompagne pour faire un point sur ta situation professionnelle.', '2017-07-11', '2018-07-11', 9, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(95, 'Besoin d’un coup de pouce dans ta recherche d’emploi ?', 'Un conseiller peut te donner un coup de pouce pour, par exemple, ton CV,\r\n ta lettre de motivation et les simulations d’entretiens…', '2017-07-11', '2018-07-11', 5, 47, 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 0, 1, 5),
(96, 'L\'emploi partagé : une autre façon de travailler !', 'Le GEDA 51 est un relais d’information sur l’emploi partagé et sur les \r\npossibilités de formations en alternance au sein d’un des groupements \r\nd’employeurs.', '2017-07-11', '2018-07-11', 9, 46, '1 rue des Marmouzets', '51100', 'Reims', '51454', 'christelle.flamion@geda51.fr', '06 98 99 11 09', 'www.geda51.fr', 0, 3, 0, 1, 5),
(97, 'Trouve ton métier dans la gendarmerie opérationnelle', 'Tu souhaites servir ton pays et tes concitoyens ? Tu souhaites \r\nparticiper à des missions de prévention, d’assistance et de sécurité ? \r\nLes corps opérationnels de la gendarmerie peuvent te proposer une large \r\ngamme de métiers différents\r\net des perspectives professionnelles variées.<br><br>', '2017-07-11', '2018-07-11', 5, 52, '10 rue Gambetta', '51100', 'Reims', '51454', 'natasha.lafile@gendarmerie.interieur.gou', ' 06 70 32 38 11', 'lagendarmerierecrute.fr', 0, 2, 0, 1, 5),
(98, 'Trouve ton métier dans les corps techniques et administratifs de la gendarmerie', 'Tu souhaites servir ton pays et tes concitoyens ? Tu souhaites \r\nparticiper à des missions de prévention, d’assistance et de sécurité ? \r\nLes corps techniques et administratifs de la gendarmerie peuvent te \r\nproposer une large gamme de métiers différents et des perspectives \r\nprofessionnelles variées.<br><br>', '2017-07-11', '2018-07-11', 5, 52, '10 rue Gambetta', '51100', 'Reims', '51454', 'natasha.lafile@gendarmerie.interieur.gou', ' 06 70 32 38 11', 'lagendarmerierecrute.fr', 0, 2, 0, 1, 5);
