INSERT INTO `bsl_professionnel` (`id_professionnel`, `nom_pro`, `type_pro`, `description_pro`, `adresse_pro`, `code_postal_pro`, `ville_pro`, `code_insee_pro`, `courriel_pro`, `telephone_pro`, `site_web_pro`, `visibilite_coordonnees`, `delai_pro`, `competence_geo`, `id_competence_geo`, `actif_pro`, `user_derniere_modif`) VALUES
(1, 'Mission locale de Reims', 'Mission locale', 'Les missions locales, sont chargées d’accueillir, d’informer, d’orienter et d’aider les jeunes en démarche d’insertion professionnelle et sociale.', '34 rue de Trianon ', '51100', 'Reims', '51454', 'contact@miloreims.com', '03.26.40.30.34', 'www.miloreims2.com ', 0, 5, 'territoire', 1, 1, NULL),
(2, 'CRIJ de Champagnes Ardennes', 'CRIJ', '', '41 rue de Talleyrand', '51100', 'Reims', '51454', '', '03 26 79 84 79', 'https://jeunes-ca.fr/', 0, 7, 'regional', 6, 1, NULL),
(11, 'Asso Lambda', '', 'association de test', '95 avenue de France ', '75013', 'Paris', '', 'contact@lambda.fr', '', 'www.lambda.fr', 0, 7, 'national', 0, 1, 1),
(21, 'Secours catholique', '', 'lorem ipsum', '106 Rue du Bac', '75007', 'Paris 07', '75107', 'contact@secours-catholique.org', '01 45 49 73 00', 'http://www.secours-catholique.org', 0, 7, 'national', 0, 1, 1),
(22, 'Asso d\'aide aux Rémois', '', '', '26 rue Paul Adam', '51100', 'Reims', '51454', 'reims@asso-reims.fr', '', 'asso-reims.fr', 0, 2, 'territoire', 1, 0, 2),
(37, ' Centre d\'information et de documentation des Jeunes (CRIJ Ile de France)', 'Association Loi 1901', 'Le CIDJ reçoit, informe et conseille le public sur place, au 101 quai Branly – Paris 15e. Il propose des animations et des ateliers collectifs thématiques. Le CIDJ dispense aussi des informations par téléphone, sur le forum en ligne de cidj.com et via les réseaux sociaux. L’accueil du CIDJ est ouvert du mardi au vendredi de 13h à 18h et le samedi de 13h à 17h.', '101 quai Branly', '75015', 'Paris 15', '75115', 'mariefranceonesime@cidj.com', '01 44 49 12 00', 'http://www.cidj.com/', 0, 5, 'territoire', 2, 1, 1),
(36, 'Coeur d\'Essonne', 'Communauté de communes', 'La communauté de commune de Coeur d\'Essonne dispose de multiples compétences. Le développement économique, l’emploi, le logement et les transports font partie de ses principaux axes d’intervention. Cœur d’Essonne Agglomération agit également dans de nombreux services de proximité : accueil des enfants de moins de 3 ans, entretien des voiries, collecte des déchets, gestion de l’eau potable, des équipements culturels et sportifs ou encore éclairage public.', '1 Place Saint-Exupéry', '91700', 'Ste Genevieve Des Bois', '91549', 'l.rochelle@coeuressonne.fr', '01 84 65 02 01', 'http://www.coeuressonne.fr/', 0, 2, 'territoire', 2, 1, 1),
(35, 'Mission Locale Trois Vallées', 'Mission locale', 'Les missions locales, sont chargées d’accueillir, d’informer, d’orienter et d’aider les jeunes en démarche d’insertion professionnelle et sociale.', '35 Rue Edouard Danaux', '91220', 'Bretigny Sur Orge', '91103', 'damien.privat@ml3v.org', '01 60 85 00 49', 'https://fr-fr.facebook.com/missionl3vallees/', 0, 7, 'territoire', 2, 1, 1),
(34, 'Mission locale du Val-d\'Orge', 'Mission locale', 'La Mission Locale du Val d\'Orge accueille tous les jeunes de 16 à 25 ans et les accompagne dans leur démarche d\'insertion sociale et professionnelle.', '27 avenue de Brétigny', '91700', 'Ste Genevieve Des Bois', '91549', 'a.dumay@mlvo-idf.fr', '01 60 15 54 00', 'https://www.facebook.com/missionlocalevaldorge/?re', 0, 5, 'territoire', 2, 1, 1),
(38, 'Coeur d\'Essonne', 'Communauté de communes', 'La communauté de commune de Coeur d\'Essonne dispose de multiples compétences. Le développement économique, l’emploi, le logement et les transports font partie de ses principaux axes d’intervention. Cœur d’Essonne Agglomération agit également dans de nombreux services de proximité : accueil des enfants de moins de 3 ans, entretien des voiries, collecte des déchets, gestion de l’eau potable, des équipements culturels et sportifs ou encore éclairage public.', '1 Place Saint-Exupéry', '91700', 'Sainte-Geneviève-des-Bois', '', 'l.rochelle@coeuressonne.fr', '01 84 65 02 01', 'http://www.coeuressonne.fr/', 0, 2, 'territoire', 2, 0, 1),
(39, 'Maison de Justice et du Droit', 'MJD', 'La Maison de Justice et du Droit propose des permanences juridiques gratuites et confidentielles autour des thèmes de la vie quotidienne. Prendre rendez vous, pas de consultation par téléphone.', '72 route de Corbeil', '91360', 'Villemoisson sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 'national', NULL, 1, 1),
(40, 'Maison de Justice et du Droit', 'MJD', 'La Maison de Justice et du Droit propose des permanences juridiques gratuites et confidentielles autour des thèmes de la vie quotidienne. Prendre rendez vous, pas de consultation par téléphone.', '72 route de Corbeil', '91360', 'Villemoisson Sur Orge', '91667', 'mjd@coeuressonne.fr', '01 69 46 81 50', 'http://www.coeuressonne.fr/votre-quotidien/vos-dro', 0, 7, 'territoire', 2, 1, 1),
(41, 'Service jeunesse du conseil départemental de l\'Essonne', 'Conseil départemental', 'Le Conseil départemental intervient dans de nombreux aspects de la vie quotidienne : L\'action sanitaire et sociale en faveur des personnes âgées, des personnes handicapées, de l\'enfance et de la famille et des personnes en difficulté; des collèges; de la voirie; de la culture; de l\'équipement des zones rurales; de la sécurité incendie; de la protection de l\'environnement et du patrimoine naturel. Dans le cadre de ses compétences complémentaires, le département mène une politique de jeunesse volontariste . Parce qu\'ils sont l\'avenir, le Conseil départemental favorise l\'autonomie des jeunes Essonniens et crée les conditions de la réussite pour tous.', '1 Place Mendès France', '91000', 'Evry', '91228', 'sdali@cd-essonne.fr', '01 60 91 91 91', 'tremplin-citoyen.essonne.fr', 0, 2, 'departemental', 91, 1, 1),
(42, 'Point Information Jeunesse (PIJ) - Brétigny-sur-Orge', 'PIJ', 'Point Information Jeunesse (PIJ) accueillent et informent les jeunes à l’échelon local en proposant : - un lieu ressource et un lieu d’accueil sans rendez-vous - une documentation en libre consultation sur tous les sujets : enseignement, formation professionnelle et métiers, emplois, logement, droit, santé, loisirs, sports, vacances, Europe, international - un lieu ouvert à tous les jeunes (collégiens, lycéens, étudiants, salariés, demandeurs d’emploi) mais aussi parents, enseignants, travailleurs sociaux...).', '30 rue Lucien Bouget', '91220', 'Brétigny sur Orge', '91103', 'c.nasso@mairie-bretigny91.fr', '01 60 84 21 95', '', 0, 7, 'territoire', 2, 1, 1),
(43, 'Point Information Jeunesse (PIJ) - Brétigny-sur-Orge', 'PIJ', 'Point Information Jeunesse (PIJ) accueillent et informent les jeunes à l’échelon local en proposant : - un lieu ressource et un lieu d’accueil sans rendez-vous - une documentation en libre consultation sur tous les sujets : enseignement, formation professionnelle et métiers, emplois, logement, droit, santé, loisirs, sports, vacances, Europe, international - un lieu ouvert à tous les jeunes (collégiens, lycéens, étudiants, salariés, demandeurs d’emploi) mais aussi parents, enseignants, travailleurs sociaux...).', '30 rue Lucien Bouget', '91220', 'Bretigny Sur Orge', '91103', 'c.nasso@mairie-bretigny91.fr', '01 60 84 21 95', 'http://www.bretigny91.fr/Jeune-et-familiale/Point-', 0, 7, 'territoire', 2, 1, 1),
(44, 'AGORAé Reims', 'Association étudiante', 'Association étudiante d\'entraide qui gère notamment une épicerie solidaire sur le campus.', '1-8 rue François Guyard', '51100', 'Reims', '51454', 'agorae@intercampus.fr', '03 26 91 88 23', 'https://intercampus.fr/site/l-innovation/agorae', 0, 7, 'territoire', 1, 0, 5),
(45, 'AGORAé Reims', 'Association Loi 1901', 'Association étudiante d\'entraide qui gère notamment une épicerie solidaire sur le campus', 'BM 1-8 rue François Guyard', 'Reims', ' 51100', '', 'agorae@intercampus.fr', '03 26 91 88 23', 'https://intercampus.fr/site/l-innovation/agorae', 0, 7, 'territoire', 1, 1, 4),
(46, 'GEDA 51', 'Groupement d\'employeurs', 'Le Groupement d’Employeurs pour le Développement Associatif de la Marne (GEDA 51) apporte une solution innovante qui permet de mutualiser les besoins et d’organiser le temps partagé entre plusieurs structures. Il est également le relais des autres Groupements d’Employeurs et peut te rediriger en fonction de ta situation et de tes besoins.\r\n', '1 rue des Marmouzets', '51100', 'Reims', '51454', 'christelle.flamion@geda51.fr', '06 98 99 11 09', 'www.geda51.fr', 0, 3, 'territoire', 1, 1, 5),
(47, 'Service Espace Métiers « promotion des métiers »', 'Association loi 1901', 'L’espace métiers apporte des éléments d’informations et des conseils sur les questions en lien avec l’emploi (découvertes des métiers, se former tout au long de la vie, évoluer professionnellement, la création d’activité et l’accompagnement à la formation ouverte à distance).', 'Association Noel Paindavoine 9 rue Noël', '51100', 'Reims', '51454', 'laura.jung@noelpaindavoine.fr', '03 26 79 11 20', '', 0, 5, 'territoire', 1, 1, 5),
(48, 'EPIDE', 'Etablissement public', 'Placé sous la tutelle du ministère de la cohésion des territoires, l’EPIDE est un acteur reconnu de l’insertion des jeunes de 18 à 25 ans sortis du système scolaire sans diplôme ni qualification professionnelle.\r\nDans ces 18 centres, ces jeunes sont accueillis en internat, dans un cadre structuré, où ils vivent les valeurs de la République au quotidien.\r\nConstruire et réussir son projet professionnel ; acquérir une formation générale et spécialisée ; apprendre à prendre soin de soi et des autres sont des objectifs partagés par les volontaires et 1100 professionnels qui les accompagnent.\r\nLa force de l’EPIDE c’est  aussi son réseau de partenaires.\r\nUn nombre toujours croissant d’employeurs accordent leur cofinance aux volontaires en leur proposant un stage  ou un emploi.\r\nDepuis sa création en 2005, l’EPIDE a formé près de 30000 citoyens responsables.\r\nL EPIDE révèle le quotient citoyen des volontaires comme celui de celles et ceux qui s’engagent à leurs côtés.\r\n', '140 Rue de la chaussée romaine', '02100', 'St Quentin', '02691', 'nathalie.lemoine@epide.fr', '06 64 02 43 11', 'www.epide.fr', 0, 5, 'regional', 6, 1, 5),
(49, 'Centre d\'Information et de Recrutement des Forces Armées de Reims (Armée de Terre)', 'CIRFA', 'Centre d’Information et de Recrutement des Forces Armées de Reims.\r\n Horaires d\'ouverture Lundi - Vendredi: 8:30-12:00, 13:30-18:00 Samedi - Dimanche: Fermé\r\n', '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'eric.queuvin@intradef.gouv.fr', '03 51 42 41 02', 'https://www.recrutement.terre.defense.gouv.fr/ou-n', 0, 2, 'territoire', 1, 1, 5),
(50, 'Centre d\'Information et de Recrutement des Forces Armées (Marine)', 'CIRFA', 'Centre d’Information et de Recrutement des Forces Armées de Reims.\r\nHoraires d’ouvertures Lundi-Vendredi 08h30-12h00 13h30-18h Samedi-Dimanche fermé\r\n', '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'sebastien.navarette@intradef.gouv.fr', '03 51 42 41 17', 'https://www.etremarin.fr/', 0, 5, 'territoire', 1, 1, 5),
(51, 'Centre d\'Information et de Recrutement des Forces Armées de Reims (Armée de l\'Air)', 'CIRFA', 'Centre d’Information et de Recrutement des Forces Armées de Reims (Armée de l’air)\r\nHoraires d’ouvertures Lundi-Vendredi 08h30-12h00 13h30-18h Samedi-Dimanche fermé\r\n', '7 boulevard Desaubeau', '51100', 'Reims', '51454', 'david.larquet@intradef.gouv.fr', '06 72 14 40 71', 'https://www.devenir-aviateur.fr', 0, 5, 'territoire', 1, 1, 5),
(52, 'Centre d\'information et de recrutement de la gendarmerie', 'CIRFA', 'La gendarmerie est une force de sécurité publique à statut militaire. Elle compte 100 000 personnels, aux missions variées. Les opérationnels chargés de la sécurité des personnes et des biens et le corps administratif chargé des missions de soutien.\r\nDu lundi 14 h 18h mardi au vendredi 09h 12h 14h 18h', '10 rue Gambetta', '51100', 'Reims', '51454', 'natasha.lafile@gendarmerie.interieur.gouv.fr', ' 06 70 32 38 11', 'lagendarmerierecrute.fr', 0, 2, 'territoire', 1, 1, 5),
(53, 'Centre d\'information et d\'orientation', 'CIO', 'Le Centre d’Information et d’Orientation est un service public gratuit de l’Education Nationale ouvert à tous.\r\nTu t’interroges sur les filières de formation, les métiers, le monde économique ?\r\nTu souhaites faire le point sur ta situation scolaire ou universitaire, ton projet ?\r\nTu désires réaliser un bilan d’orientation avec psychologue de l’orientation ?\r\nLe psychologue de l’orientation  t’accueilles, t’informes et te conseilles.\r\n', '17 boulevard de la paix', '51100', 'Reims', '51454', 'chantal.warin@ac-reims.fr', '03 26 05 80 77', 'http://www.ac-reims.fr/cid75537/cio-reims.html', 0, 5, 'territoire', 1, 1, 5),
(54, 'APEC', 'Association loi 1901', 'Vous démarrez votre première recherche d\'emploi ? Un consultant vous conseille pour identifier votre marché de l’emploi, structurer votre démarche et trouver l’emploi qui vous correspond. Mettez toutes les chances de votre côté !', '14 rue Edouard Mignot', '51100', 'Reims', '51454', 'jermouna.ahmed-malek@apec.fr', '03 26 79 82 74', 'Apec.fr', 0, 7, 'territoire', 1, 1, 5);
